CREATE PROCEDURE ATV_ProfissionalAuto  
(    
	@UserName VARCHAR(30)
	,@Token VARCHAR(100)    

)    
AS

BEGIN SET NOCOUNT ON DECLARE @Result BIT = 0;
BEGIN TRY
